import React, { useEffect, useState } from 'react';
import { Route, Routes } from 'react-router-dom';
import Card from '../Card';
import OverviewAction from './OverviewAction';

export default async function Overview() {
  const  [overviewData,setOverviewData]=useState()

    let output
    useEffect(() => {

      fetch('http://127.0.0.1:5000/token:qwhu67fv56frt5drfx45e/overviews',
      ).then(resp=>resp.json()).then(re=>output = re)
      },[])

     setOverviewData(output)

  // Fetch()
  console.log(overviewData)

  // let data={average : `${overviewData.dailyAverageReservationCount} reservations served daily on average`}

  return (
    <Routes>
      <Route path="/*" element={<OverviewAction overviewData={overviewData}/>}/>
    </Routes>
      );
}
